import React from "react";
import style from "./a.module.css";
import footer from "../../assets/footer.png";

const Footer = () => {
  return (
    <div>
      <div className={style.contentDiv}>
        <div className={style.compInfo}></div>
        <div className={style.menuDiv}></div>
        <div className={style.contactDiv}></div>
      </div>
      <div className={style.endDiv}></div>
      <h1>sdfasd</h1>
      <img src={footer} alt="" className={style.footer} />
    </div>
  );
};

export default Footer;
